var AWS = require('aws-sdk');

var source = "data:image/png;base64,";

var target = "data:image/png;base64,";


function atob (b64Encoded) {
  return new Buffer.from(b64Encoded, 'base64').toString('binary');
}

function compareFaces( rekognition, params) {
  return new Promise(function(resolve, reject) {
      rekognition.compareFaces(params, function(err, data) {
       if (err) {
         console.log("Error:", err);
          return reject(Error(err));
       }  else {
          return resolve(JSON.stringify(data));
       }
    })
  });
}

function getImageBytes(imageData) {
  var image = null;

  try {
    image = atob(imageData.split("data:image/png;base64,")[1]);

    var length = image.length;
    imageBytes = new ArrayBuffer(length);
    var ua = new Uint8Array(imageBytes);
    for ( var i=0;i < length; i++ ) {
      ua[i] = image.charCodeAt(i);
    }
  }catch( err ) {
    console.log("Error:", err);
  }
    return imageBytes;
}

